import React from 'react'

const initialstate = {
    users:[],
}
export default function userReducer(state = initialstate,action) {
    console.log(56,action)
     switch(action.type)
     {

        case "GET_LOGIN":
             return {
                 ...state,
                users : action.payload
                 }
        case "GET_LOGUP":
            return {
                ...state,
               users : action.payload
                   }         

        case "GET_LOGIN":
        return {
            ...state,
             users: action.payload
        }

        default:
            return state;
             }
}
